def sort_string(s, ordering):
    chars = {char: None for char in ordering}
    remaining_chars = set(s) - set(ordering)
    ordered_chars = sorted([char for char in s if char in chars], key=ordering.index)
    ordered_chars += sorted(list(remaining_chars), key=s.index)
    return ''.join(ordered_chars)

